        if(fichaPaciente.esta_embarazada === 0){
            setfichaPaciente({
                ...fichaPaciente,
                esta_embarazada: 1
            })
          
        }
        else{
            setfichaPaciente({
                ...fichaPaciente,
                esta_embarazada: 0
            })
      
        }
        
    }
